met Saoirse Ronan, Gemma Arterton en Caleb Landry Jones

Het verhaal volgt een moeder (Arterton) die, toen ze veranderd werd in een vampier, haar eigen dochter Eleanor (Ronan) overtuigt om ook een bloedzuiger te worden. De twee vormen een dodelijk paar en doen zich af en toe voor als zusters. Het duo komt in een kleine Britse stad en onthult hun ware identiteit. Hun komst zorgt ervoor dat een tiener die terminaal ziek is (Jones) zijn sterfelijkheid ter discussie stelt, terwijl Eleanor op haar beurt haar eigen onsterfelijkheid ter discussie stelt.



